import React from 'react';
import styled from "styled-components";
import { NavLink } from "react-router-dom"

const OwnLink = styled(NavLink)`
  cursor: pointer;
`;

const Link = ({to, children}) => {
    return(
        <NavLink to={to}>
            {children}
        </NavLink>
    )
}

export default Link;
